        public static byte[] AESEncrypt256(byte[] Input, byte[] key)
        {
            byte[] iv = new byte[16] { 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00 };

            using (Aes encryptor = Aes.Create())
            {
                encryptor.Mode = CipherMode.CBC;
                encryptor.Key = key;
                encryptor.IV = iv;
                encryptor.Padding = PaddingMode.PKCS7;

                using (MemoryStream memoryStream = new MemoryStream())
                using (ICryptoTransform aesEncryptor = encryptor.CreateEncryptor())
                using (CryptoStream cryptoStream = new CryptoStream(memoryStream, aesEncryptor, CryptoStreamMode.Write))
                {

                    cryptoStream.Write(Input, 0, Input.Length);
                    cryptoStream.FlushFinalBlock();
                    return memoryStream.ToArray();
                }
            }
        }
